20251021165111	{"-- Migration: Création table enregistrements_groupes + bucket Supabase Storage\n-- Date: 2025-01-21\n-- Description: Permet aux apprenants d'enregistrer leur voix pour chaque groupe de sens\n\n-- ============================================================================\n-- 1. CRÉATION DE LA TABLE enregistrements_groupes\n-- ============================================================================\n\nCREATE TABLE IF NOT EXISTS enregistrements_groupes (\n    id SERIAL PRIMARY KEY,\n    groupe_sens_id INTEGER NOT NULL REFERENCES groupes_sens(id) ON DELETE CASCADE,\n    apprenant_id UUID NOT NULL REFERENCES users(id) ON DELETE CASCADE,\n    audio_url TEXT NOT NULL,           -- Chemin dans Supabase Storage\n    duree_secondes DECIMAL(10,2),      -- Durée de l'enregistrement\n    taille_bytes INTEGER,              -- Taille du fichier en octets\n    created_at TIMESTAMP WITH TIME ZONE DEFAULT NOW(),\n    updated_at TIMESTAMP WITH TIME ZONE DEFAULT NOW(),\n\n    -- Contrainte : Un seul enregistrement par apprenant par groupe\n    CONSTRAINT unique_enregistrement_par_apprenant_groupe\n        UNIQUE(groupe_sens_id, apprenant_id)\n);\n\n-- ============================================================================\n-- 2. INDEX POUR PERFORMANCES\n-- ============================================================================\n\n-- Index sur apprenant_id pour requêtes par utilisateur\nCREATE INDEX idx_enregistrements_groupes_apprenant\n    ON enregistrements_groupes(apprenant_id);\n\n-- Index sur groupe_sens_id pour requêtes par groupe\nCREATE INDEX idx_enregistrements_groupes_groupe\n    ON enregistrements_groupes(groupe_sens_id);\n\n-- Index composite pour requêtes fréquentes\nCREATE INDEX idx_enregistrements_groupes_apprenant_groupe\n    ON enregistrements_groupes(apprenant_id, groupe_sens_id);\n\n-- ============================================================================\n-- 3. TRIGGER POUR updated_at\n-- ============================================================================\n\n-- Fonction de mise à jour du timestamp\nCREATE OR REPLACE FUNCTION update_enregistrements_groupes_updated_at()\nRETURNS TRIGGER AS $$\nBEGIN\n    NEW.updated_at = NOW();\n    RETURN NEW;\nEND;\n$$ LANGUAGE plpgsql;\n\n-- Trigger sur UPDATE\nCREATE TRIGGER trigger_update_enregistrements_groupes_updated_at\n    BEFORE UPDATE ON enregistrements_groupes\n    FOR EACH ROW\n    EXECUTE FUNCTION update_enregistrements_groupes_updated_at();\n\n-- ============================================================================\n-- 4. COMMENTAIRES POUR DOCUMENTATION\n-- ============================================================================\n\nCOMMENT ON TABLE enregistrements_groupes IS\n    'Enregistrements audio personnels des apprenants pour chaque groupe de sens';\n\nCOMMENT ON COLUMN enregistrements_groupes.groupe_sens_id IS\n    'Référence vers le groupe de sens enregistré';\n\nCOMMENT ON COLUMN enregistrements_groupes.apprenant_id IS\n    'Apprenant ayant réalisé l''enregistrement';\n\nCOMMENT ON COLUMN enregistrements_groupes.audio_url IS\n    'Chemin du fichier audio dans Supabase Storage (format: [apprenant_id]/[texte_id]/groupe_[groupe_id].webm)';\n\nCOMMENT ON COLUMN enregistrements_groupes.duree_secondes IS\n    'Durée de l''enregistrement en secondes (calculée côté client)';\n\nCOMMENT ON COLUMN enregistrements_groupes.taille_bytes IS\n    'Taille du fichier audio en octets';\n\n-- ============================================================================\n-- 6. ROW LEVEL SECURITY (RLS)\n-- ============================================================================\n\n-- Activer RLS sur la table\nALTER TABLE enregistrements_groupes ENABLE ROW LEVEL SECURITY;\n\n-- Politique: Les apprenants peuvent LIRE leurs propres enregistrements\nCREATE POLICY \\"Users can read their own recordings\\"\n    ON enregistrements_groupes\n    FOR SELECT\n    USING (apprenant_id = auth.uid());\n\n-- Politique: Les apprenants peuvent CRÉER leurs propres enregistrements\nCREATE POLICY \\"Users can create their own recordings\\"\n    ON enregistrements_groupes\n    FOR INSERT\n    WITH CHECK (apprenant_id = auth.uid());\n\n-- Politique: Les apprenants peuvent METTRE À JOUR leurs propres enregistrements\nCREATE POLICY \\"Users can update their own recordings\\"\n    ON enregistrements_groupes\n    FOR UPDATE\n    USING (apprenant_id = auth.uid())\n    WITH CHECK (apprenant_id = auth.uid());\n\n-- Politique: Les apprenants peuvent SUPPRIMER leurs propres enregistrements\nCREATE POLICY \\"Users can delete their own recordings\\"\n    ON enregistrements_groupes\n    FOR DELETE\n    USING (apprenant_id = auth.uid());\n\n-- Politique: Les admins peuvent TOUT faire\nCREATE POLICY \\"Admins can manage all recordings\\"\n    ON enregistrements_groupes\n    FOR ALL\n    USING (\n        EXISTS (\n            SELECT 1 FROM users\n            WHERE users.id = auth.uid()\n            AND users.role = 'admin'\n        )\n    );\n\n-- ============================================================================\n-- 7. FONCTION UTILITAIRE: Récupérer les enregistrements d'un texte\n-- ============================================================================\n\nCREATE OR REPLACE FUNCTION get_enregistrements_by_texte(\n    p_texte_id INTEGER,\n    p_apprenant_id UUID\n)\nRETURNS TABLE (\n    id INTEGER,\n    groupe_sens_id INTEGER,\n    ordre_groupe INTEGER,\n    audio_url TEXT,\n    duree_secondes DECIMAL,\n    taille_bytes INTEGER,\n    created_at TIMESTAMP WITH TIME ZONE\n) AS $$\nBEGIN\n    RETURN QUERY\n    SELECT\n        e.id,\n        e.groupe_sens_id,\n        g.ordre_groupe,\n        e.audio_url,\n        e.duree_secondes,\n        e.taille_bytes,\n        e.created_at\n    FROM enregistrements_groupes e\n    INNER JOIN groupes_sens g ON e.groupe_sens_id = g.id\n    WHERE g.texte_reference_id = p_texte_id\n      AND e.apprenant_id = p_apprenant_id\n    ORDER BY g.ordre_groupe;\nEND;\n$$ LANGUAGE plpgsql SECURITY DEFINER;\n\nCOMMENT ON FUNCTION get_enregistrements_by_texte IS\n    'Récupère tous les enregistrements d''un apprenant pour un texte donné, triés par ordre des groupes';\n"}	create_enregistrements_groupes	mathieujouteux@gmail.com	\N
20251022110519	{"-- ============================================================================\n-- TABLE: enregistrements_mots\n-- Description: Enregistrements vocaux des apprenants pour des mots individuels\n-- Utilisé dans l'exercice Mono/Multisyllabes\n-- ============================================================================\n\nCREATE TABLE IF NOT EXISTS public.enregistrements_mots (\n    id BIGSERIAL PRIMARY KEY,\n    apprenant_id UUID NOT NULL REFERENCES public.users(id) ON DELETE CASCADE,\n    mot TEXT NOT NULL,\n    audio_url TEXT NOT NULL,\n    texte_id INTEGER REFERENCES public.textes_references(id) ON DELETE SET NULL,\n    created_at TIMESTAMP WITH TIME ZONE DEFAULT NOW(),\n    updated_at TIMESTAMP WITH TIME ZONE DEFAULT NOW()\n);\n\n-- ============================================================================\n-- INDEX pour améliorer les performances\n-- ============================================================================\n\n-- Index sur apprenant_id (requêtes fréquentes par apprenant)\nCREATE INDEX IF NOT EXISTS idx_enregistrements_mots_apprenant\nON public.enregistrements_mots(apprenant_id);\n\n-- Index sur mot (recherche par mot)\nCREATE INDEX IF NOT EXISTS idx_enregistrements_mots_mot\nON public.enregistrements_mots(mot);\n\n-- Index composite pour requêtes apprenant + mot\nCREATE INDEX IF NOT EXISTS idx_enregistrements_mots_apprenant_mot\nON public.enregistrements_mots(apprenant_id, mot);\n\n-- ============================================================================\n-- COMMENTAIRES\n-- ============================================================================\n\nCOMMENT ON TABLE public.enregistrements_mots IS\n'Enregistrements vocaux des apprenants pour des mots individuels (exercice Mono/Multisyllabes)';\n\nCOMMENT ON COLUMN public.enregistrements_mots.mot IS\n'Le mot enregistré (en minuscules, normalisé)';\n\nCOMMENT ON COLUMN public.enregistrements_mots.audio_url IS\n'URL Supabase Storage du fichier audio (bucket: enregistrements-audio)';\n\nCOMMENT ON COLUMN public.enregistrements_mots.texte_id IS\n'Optionnel: texte de référence d''où provient le mot';\n\n-- ============================================================================\n-- RLS (Row Level Security)\n-- ============================================================================\n\n-- Activer RLS sur la table\nALTER TABLE public.enregistrements_mots ENABLE ROW LEVEL SECURITY;\n\n-- Politique SELECT : L'apprenant peut voir ses propres enregistrements\nCREATE POLICY \\"Les apprenants peuvent voir leurs propres enregistrements de mots\\"\nON public.enregistrements_mots\nFOR SELECT\nUSING (apprenant_id = (current_setting('request.jwt.claims', true)::json->>'apprenant_id')::uuid);\n\n-- Politique INSERT : L'apprenant peut créer ses propres enregistrements\nCREATE POLICY \\"Les apprenants peuvent créer leurs propres enregistrements de mots\\"\nON public.enregistrements_mots\nFOR INSERT\nWITH CHECK (apprenant_id = (current_setting('request.jwt.claims', true)::json->>'apprenant_id')::uuid);\n\n-- Politique DELETE : L'apprenant peut supprimer ses propres enregistrements\nCREATE POLICY \\"Les apprenants peuvent supprimer leurs propres enregistrements de mots\\"\nON public.enregistrements_mots\nFOR DELETE\nUSING (apprenant_id = (current_setting('request.jwt.claims', true)::json->>'apprenant_id')::uuid);\n\n-- ============================================================================\n-- TRIGGER pour updated_at\n-- ============================================================================\n\n-- Fonction trigger pour mettre à jour updated_at automatiquement\nCREATE OR REPLACE FUNCTION update_enregistrements_mots_updated_at()\nRETURNS TRIGGER AS $$\nBEGIN\n    NEW.updated_at = NOW();\n    RETURN NEW;\nEND;\n$$ LANGUAGE plpgsql;\n\n-- Créer le trigger\nCREATE TRIGGER trigger_update_enregistrements_mots_updated_at\nBEFORE UPDATE ON public.enregistrements_mots\nFOR EACH ROW\nEXECUTE FUNCTION update_enregistrements_mots_updated_at();\n\n-- ============================================================================\n-- CONTRAINTES\n-- ============================================================================\n\n-- Le mot ne doit pas être vide\nALTER TABLE public.enregistrements_mots\nADD CONSTRAINT check_mot_not_empty CHECK (LENGTH(TRIM(mot)) > 0);\n\n-- Un apprenant ne peut avoir qu'un seul enregistrement par mot\nCREATE UNIQUE INDEX IF NOT EXISTS unique_apprenant_mot\nON public.enregistrements_mots(apprenant_id, LOWER(mot));"}	create_enregistrements_mots_table	mathieujouteux@gmail.com	\N
20251022134625	{"-- Migration : Optimisations table corrections_mono_multi\n-- Date : 2025-01-22\n-- Description : Ajout d'index et trigger pour améliorer les performances\n\n-- 1. Créer un index sur le champ 'mot' pour accélérer les recherches\n-- (Le champ est déjà UNIQUE donc possède déjà un index, mais on s'assure qu'il existe)\nCREATE INDEX IF NOT EXISTS idx_corrections_mono_multi_mot \nON corrections_mono_multi(mot);\n\n-- 2. Créer un trigger pour mettre à jour automatiquement 'updated_at'\nCREATE OR REPLACE FUNCTION update_corrections_mono_multi_updated_at()\nRETURNS TRIGGER AS $$\nBEGIN\n    NEW.updated_at = NOW();\n    RETURN NEW;\nEND;\n$$ LANGUAGE plpgsql;\n\n-- Supprimer le trigger s'il existe déjà\nDROP TRIGGER IF EXISTS trigger_update_corrections_mono_multi_updated_at \nON corrections_mono_multi;\n\n-- Créer le trigger\nCREATE TRIGGER trigger_update_corrections_mono_multi_updated_at\n    BEFORE UPDATE ON corrections_mono_multi\n    FOR EACH ROW\n    EXECUTE FUNCTION update_corrections_mono_multi_updated_at();\n\n-- 3. Ajouter un commentaire sur la table pour documenter son usage\nCOMMENT ON TABLE corrections_mono_multi IS \n'Corrections centralisées de classification mono/multisyllabes.\nLes corrections validées par admin dans cette table s''appliquent à TOUS les apprenants.\nPriorité : corrections_mono_multi > algorithme local';\n\n-- 4. Ajouter des commentaires sur les colonnes importantes\nCOMMENT ON COLUMN corrections_mono_multi.mot IS \n'Mot en minuscules (clé unique)';\n\nCOMMENT ON COLUMN corrections_mono_multi.classification_correcte IS \n'Classification correcte: \\"monosyllabe\\" ou \\"multisyllabe\\"';\n\nCOMMENT ON COLUMN corrections_mono_multi.nombre_applications IS \n'Nombre de fois où cette correction a été appliquée (compteur automatique)';\n\n-- Migration terminée avec succès\nSELECT 'Migration add_corrections_mono_multi_optimizations appliquée avec succès' AS result;"}	add_corrections_mono_multi_optimizations	mathieujouteux@gmail.com	\N
20251022140604	{"-- Migration : Copier les corrections existantes vers table centralisée\n-- Date : 2025-01-22\n-- Description : Migrer tous les mots validés par admin (valide_par_admin=true) \n--               depuis mots_classifies vers corrections_mono_multi\n\n-- 1. Insérer toutes les corrections historiques\nINSERT INTO corrections_mono_multi (\n    mot,\n    classification_correcte,\n    ancienne_classification,\n    source,\n    admin_correcteur,\n    commentaire,\n    date_creation,\n    date_modification,\n    updated_at,\n    nombre_applications\n)\nSELECT DISTINCT ON (mot)\n    LOWER(mot) AS mot,\n    CASE \n        WHEN classification = 'mono' THEN 'monosyllabe'\n        WHEN classification = 'multi' THEN 'multisyllabe'\n        ELSE classification\n    END AS classification_correcte,\n    -- On ne connaît pas l'ancienne classification, mettre NULL\n    NULL AS ancienne_classification,\n    'migration_historique' AS source,\n    COALESCE(\n        (SELECT CONCAT(prenom, ' ', nom) \n         FROM users \n         WHERE users.id = mots_classifies.validated_by \n         LIMIT 1),\n        'admin_historique'\n    ) AS admin_correcteur,\n    'Correction migrée depuis mots_classifies (validation historique)' AS commentaire,\n    validated_at AS date_creation,\n    validated_at AS date_modification,\n    validated_at AS updated_at,\n    0 AS nombre_applications\nFROM mots_classifies\nWHERE valide_par_admin = true\n  AND mot IS NOT NULL\n  AND classification IN ('mono', 'multi')\nORDER BY mot, validated_at DESC\nON CONFLICT (mot) DO NOTHING;\n\n-- 2. Compter les corrections migrées\nSELECT \n    COUNT(*) AS corrections_migrees,\n    'Corrections historiques migrées avec succès' AS message\nFROM corrections_mono_multi\nWHERE source = 'migration_historique';"}	migrate_existing_corrections_to_centralized	mathieujouteux@gmail.com	\N
20251022190557	{"-- Migration temporaire pour debug : trouver le texte \\"test 2\\"\nSELECT \n    t.id, \n    t.titre, \n    t.apprenant_id,\n    t.nombre_mots_total,\n    t.created_at\nFROM textes_references t\nWHERE LOWER(titre) LIKE '%test%'\nORDER BY created_at DESC\nLIMIT 10;"}	debug_find_test2_text	mathieujouteux@gmail.com	\N
20251027183520	{"-- ============================================\n-- TABLES POUR L'ORGANISATION PÉDAGOGIQUE\n-- ============================================\n\n-- Table principale : séances pédagogiques\nCREATE TABLE IF NOT EXISTS seances_pedagogiques (\n    id UUID PRIMARY KEY DEFAULT gen_random_uuid(),\n    date DATE NOT NULL,\n    creneau VARCHAR(2) NOT NULL CHECK (creneau IN ('M', 'AM')),\n    lieu_id UUID REFERENCES lieux(id) ON DELETE CASCADE,\n    partie INTEGER DEFAULT 1 CHECK (partie IN (1, 2)),\n    created_at TIMESTAMP WITH TIME ZONE DEFAULT NOW(),\n    updated_at TIMESTAMP WITH TIME ZONE DEFAULT NOW(),\n\n    -- Contrainte d'unicité : une seule séance par date/créneau/lieu/partie\n    UNIQUE(date, creneau, lieu_id, partie)\n);\n\n-- Table des associations : formateur/salarié → apprenant\nCREATE TABLE IF NOT EXISTS associations_pedagogiques (\n    id UUID PRIMARY KEY DEFAULT gen_random_uuid(),\n    seance_id UUID REFERENCES seances_pedagogiques(id) ON DELETE CASCADE,\n\n    -- Encadrant : formateur ou salarié (référence à users.id)\n    -- Les formateurs ont role='formateur', les salariés ont role='salarié'\n    encadrant_id UUID REFERENCES users(id) ON DELETE CASCADE,\n\n    -- Apprenant (référence à users.id avec role='apprenant')\n    apprenant_id UUID REFERENCES users(id) ON DELETE CASCADE,\n\n    -- Notes pédagogiques (ce que l'apprenant va faire)\n    notes_pedagogiques TEXT,\n\n    created_at TIMESTAMP WITH TIME ZONE DEFAULT NOW(),\n    updated_at TIMESTAMP WITH TIME ZONE DEFAULT NOW(),\n\n    -- Un apprenant ne peut être associé qu'une fois par séance\n    UNIQUE(seance_id, apprenant_id)\n);\n\n-- Index pour optimiser les requêtes\nCREATE INDEX IF NOT EXISTS idx_seances_date_creneau_lieu\n    ON seances_pedagogiques(date, creneau, lieu_id);\n\nCREATE INDEX IF NOT EXISTS idx_associations_seance\n    ON associations_pedagogiques(seance_id);\n\nCREATE INDEX IF NOT EXISTS idx_associations_encadrant\n    ON associations_pedagogiques(encadrant_id);\n\nCREATE INDEX IF NOT EXISTS idx_associations_apprenant\n    ON associations_pedagogiques(apprenant_id);\n\n-- Trigger pour mettre à jour updated_at automatiquement\nCREATE OR REPLACE FUNCTION update_updated_at_column()\nRETURNS TRIGGER AS $$\nBEGIN\n    NEW.updated_at = NOW();\n    RETURN NEW;\nEND;\n$$ language 'plpgsql';\n\nCREATE TRIGGER update_seances_pedagogiques_updated_at\n    BEFORE UPDATE ON seances_pedagogiques\n    FOR EACH ROW\n    EXECUTE FUNCTION update_updated_at_column();\n\nCREATE TRIGGER update_associations_pedagogiques_updated_at\n    BEFORE UPDATE ON associations_pedagogiques\n    FOR EACH ROW\n    EXECUTE FUNCTION update_updated_at_column();\n\n-- Commentaires pour la documentation\nCOMMENT ON TABLE seances_pedagogiques IS 'Séances pédagogiques organisées (planning détaillé par créneau)';\nCOMMENT ON TABLE associations_pedagogiques IS 'Associations encadrant (formateur/salarié) → apprenant avec notes pédagogiques';\nCOMMENT ON COLUMN seances_pedagogiques.partie IS 'Partie de la séance (1 ou 2) pour les séances divisées';\nCOMMENT ON COLUMN associations_pedagogiques.encadrant_id IS 'Référence vers users.id (formateur ou salarié)';\nCOMMENT ON COLUMN associations_pedagogiques.apprenant_id IS 'Référence vers users.id (apprenant)';\nCOMMENT ON COLUMN associations_pedagogiques.notes_pedagogiques IS 'Objectifs/activités prévues pour l''apprenant durant la séance';"}	create_organisation_pedagogique_tables	mathieujouteux@gmail.com	\N
20251028201720	{"-- Migration : Ajout de la colonne updated_at à planning_hebdomadaire\n-- Date : 2025-10-28\n-- Objectif : Tracker les modifications de planning pour le système de notifications PWA\n\n-- Étape 1 : Ajouter la colonne updated_at\nALTER TABLE planning_hebdomadaire\nADD COLUMN IF NOT EXISTS updated_at TIMESTAMP WITH TIME ZONE DEFAULT NOW();\n\n-- Étape 2 : Initialiser updated_at avec created_at pour les enregistrements existants\nUPDATE planning_hebdomadaire\nSET updated_at = created_at\nWHERE updated_at IS NULL;\n\n-- Étape 3 : Créer une fonction trigger pour mise à jour automatique\nCREATE OR REPLACE FUNCTION update_planning_hebdomadaire_timestamp()\nRETURNS TRIGGER AS $$\nBEGIN\n  NEW.updated_at = NOW();\n  RETURN NEW;\nEND;\n$$ LANGUAGE plpgsql;\n\n-- Étape 4 : Créer le trigger sur la table planning_hebdomadaire\nDROP TRIGGER IF EXISTS trigger_update_planning_hebdomadaire_timestamp ON planning_hebdomadaire;\n\nCREATE TRIGGER trigger_update_planning_hebdomadaire_timestamp\nBEFORE UPDATE ON planning_hebdomadaire\nFOR EACH ROW\nEXECUTE FUNCTION update_planning_hebdomadaire_timestamp();\n\n-- Vérification : Afficher la structure de la table\nCOMMENT ON COLUMN planning_hebdomadaire.updated_at IS 'Date et heure de la dernière modification (mise à jour automatique via trigger)';"}	add_updated_at_planning_hebdomadaire	mathieujouteux@gmail.com	\N
20251028201815	{"-- Migration : Création de la table formateurs_planning_last_check\n-- Date : 2025-10-28\n-- Objectif : Tracker la dernière consultation du planning par chaque formateur\n--            pour détecter les changements non consultés\n\n-- Étape 1 : Créer la table\nCREATE TABLE IF NOT EXISTS formateurs_planning_last_check (\n  formateur_id UUID PRIMARY KEY REFERENCES users(id) ON DELETE CASCADE,\n  last_check_at TIMESTAMP WITH TIME ZONE DEFAULT NOW(),\n  updated_at TIMESTAMP WITH TIME ZONE DEFAULT NOW()\n);\n\n-- Étape 2 : Ajouter un index pour les performances\nCREATE INDEX IF NOT EXISTS idx_formateurs_planning_last_check_formateur\nON formateurs_planning_last_check(formateur_id);\n\n-- Étape 3 : Créer une fonction trigger pour updated_at\nCREATE OR REPLACE FUNCTION update_formateurs_planning_last_check_timestamp()\nRETURNS TRIGGER AS $$\nBEGIN\n  NEW.updated_at = NOW();\n  RETURN NEW;\nEND;\n$$ LANGUAGE plpgsql;\n\n-- Étape 4 : Créer le trigger\nDROP TRIGGER IF EXISTS trigger_update_formateurs_planning_last_check_timestamp ON formateurs_planning_last_check;\n\nCREATE TRIGGER trigger_update_formateurs_planning_last_check_timestamp\nBEFORE UPDATE ON formateurs_planning_last_check\nFOR EACH ROW\nEXECUTE FUNCTION update_formateurs_planning_last_check_timestamp();\n\n-- Étape 5 : Initialiser la table avec tous les formateurs existants\nINSERT INTO formateurs_planning_last_check (formateur_id, last_check_at)\nSELECT id, NOW()\nFROM users\nWHERE role = 'formateur' AND archive = false\nON CONFLICT (formateur_id) DO NOTHING;\n\n-- Étape 6 : Ajouter des commentaires pour la documentation\nCOMMENT ON TABLE formateurs_planning_last_check IS 'Suivi de la dernière consultation du planning par chaque formateur (pour notifications PWA)';\nCOMMENT ON COLUMN formateurs_planning_last_check.formateur_id IS 'ID du formateur (FK vers users.id)';\nCOMMENT ON COLUMN formateurs_planning_last_check.last_check_at IS 'Date et heure de la dernière consultation du planning par ce formateur';\nCOMMENT ON COLUMN formateurs_planning_last_check.updated_at IS 'Date et heure de la dernière modification de cet enregistrement';"}	create_formateurs_planning_last_check	mathieujouteux@gmail.com	\N
20251029081850	{"-- Migration: Création de la table profils_identite\n-- Date: 2025-10-29\n-- Description: Profils d'identité complets pour les apprenants (exercices formulaires administratifs)\n\n-- ============================================================================\n-- Table: profils_identite\n-- Description: Stocke les informations personnelles complètes des apprenants\n--              pour les exercices de remplissage de formulaires\n-- ============================================================================\n\nCREATE TABLE IF NOT EXISTS profils_identite (\n    id UUID PRIMARY KEY DEFAULT gen_random_uuid(),\n\n    -- Référence à l'apprenant\n    apprenant_id UUID NOT NULL REFERENCES users(id) ON DELETE CASCADE,\n\n    -- Identité civile\n    nom TEXT,\n    prenom TEXT,\n    nom_naissance TEXT,\n    date_naissance DATE,\n    lieu_naissance TEXT,\n    nationalite TEXT DEFAULT 'Française',\n\n    -- Adresse\n    adresse_ligne1 TEXT,\n    adresse_ligne2 TEXT,\n    code_postal TEXT,\n    ville TEXT,\n    pays TEXT DEFAULT 'France',\n\n    -- Contact (redondant avec users mais permet cohérence dans les exercices)\n    telephone TEXT,\n    email TEXT,\n    telephone_urgence TEXT,\n\n    -- Situation familiale\n    situation_familiale TEXT CHECK (situation_familiale IN ('celibataire', 'marie', 'pacse', 'divorce', 'veuf', NULL)),\n    nombre_enfants INTEGER DEFAULT 0 CHECK (nombre_enfants >= 0),\n\n    -- Informations administratives\n    numero_secu TEXT,\n    numero_allocataire TEXT,\n    numero_pole_emploi TEXT,\n\n    -- Métadonnées\n    complete BOOLEAN DEFAULT false,\n    created_at TIMESTAMPTZ DEFAULT NOW(),\n    updated_at TIMESTAMPTZ DEFAULT NOW(),\n\n    -- Contrainte: un apprenant ne peut avoir qu'un seul profil\n    UNIQUE(apprenant_id)\n);\n\n-- ============================================================================\n-- Index\n-- ============================================================================\n\nCREATE INDEX IF NOT EXISTS idx_profils_identite_apprenant ON profils_identite(apprenant_id);\nCREATE INDEX IF NOT EXISTS idx_profils_identite_complete ON profils_identite(complete);\n\n-- ============================================================================\n-- Trigger pour updated_at\n-- ============================================================================\n\nCREATE OR REPLACE FUNCTION update_profils_identite_updated_at()\nRETURNS TRIGGER AS $$\nBEGIN\n    NEW.updated_at = NOW();\n    RETURN NEW;\nEND;\n$$ LANGUAGE plpgsql;\n\nCREATE TRIGGER trigger_profils_identite_updated_at\n    BEFORE UPDATE ON profils_identite\n    FOR EACH ROW\n    EXECUTE FUNCTION update_profils_identite_updated_at();\n\n-- ============================================================================\n-- Commentaires\n-- ============================================================================\n\nCOMMENT ON TABLE profils_identite IS 'Profils d''identité complets des apprenants pour les exercices de formulaires administratifs';\n\nCOMMENT ON COLUMN profils_identite.apprenant_id IS 'Référence à l''apprenant (table users)';\nCOMMENT ON COLUMN profils_identite.nom IS 'Nom de famille actuel';\nCOMMENT ON COLUMN profils_identite.nom_naissance IS 'Nom de naissance (si différent)';\nCOMMENT ON COLUMN profils_identite.situation_familiale IS 'Situation familiale: celibataire, marie, pacse, divorce, veuf';\nCOMMENT ON COLUMN profils_identite.numero_secu IS 'Numéro de sécurité sociale';\nCOMMENT ON COLUMN profils_identite.numero_allocataire IS 'Numéro d''allocataire CAF';\nCOMMENT ON COLUMN profils_identite.numero_pole_emploi IS 'Identifiant Pôle Emploi';\nCOMMENT ON COLUMN profils_identite.complete IS 'Indique si le profil est considéré comme complet par l''apprenant';"}	create_profils_identite	mathieujouteux@gmail.com	\N
20251029081909	{"-- Migration: Création de la table stats_formulaires_champs\n-- Date: 2025-10-29\n-- Description: Tracking détaillé des performances par champ dans les exercices de formulaires\n\n-- ============================================================================\n-- Table: stats_formulaires_champs\n-- Description: Enregistre les statistiques détaillées par champ pour identifier\n--              les difficultés spécifiques des apprenants (ex: email difficile, nom facile)\n-- ============================================================================\n\nCREATE TABLE IF NOT EXISTS stats_formulaires_champs (\n    id UUID PRIMARY KEY DEFAULT gen_random_uuid(),\n\n    -- Références\n    assignation_id UUID NOT NULL REFERENCES formation_exercices_assignations(id) ON DELETE CASCADE,\n    apprenant_id UUID NOT NULL REFERENCES users(id) ON DELETE CASCADE,\n    exercice_id UUID NOT NULL REFERENCES formation_exercices(id) ON DELETE CASCADE,\n\n    -- Identification du champ\n    champ_id TEXT NOT NULL,\n    champ_label TEXT NOT NULL,\n    champ_type TEXT NOT NULL, -- text, email, tel, date, number...\n\n    -- Résultat\n    correct BOOLEAN NOT NULL,\n    valeur_attendue TEXT,\n    valeur_saisie TEXT,\n\n    -- Temps de saisie (pour identifier les champs qui posent problème)\n    temps_saisie_secondes INTEGER,\n\n    -- Métadonnées\n    created_at TIMESTAMPTZ DEFAULT NOW()\n);\n\n-- ============================================================================\n-- Index pour les recherches fréquentes\n-- ============================================================================\n\n-- Index pour requêtes par apprenant (suivi individuel)\nCREATE INDEX IF NOT EXISTS idx_stats_champs_apprenant ON stats_formulaires_champs(apprenant_id);\n\n-- Index pour requêtes par exercice (analyse d'un formulaire spécifique)\nCREATE INDEX IF NOT EXISTS idx_stats_champs_exercice ON stats_formulaires_champs(exercice_id);\n\n-- Index pour requêtes par champ (stats globales par type de champ)\nCREATE INDEX IF NOT EXISTS idx_stats_champs_champ_id ON stats_formulaires_champs(champ_id);\n\n-- Index pour filtrer par résultat (identifier les erreurs)\nCREATE INDEX IF NOT EXISTS idx_stats_champs_correct ON stats_formulaires_champs(correct);\n\n-- Index composite pour stats par apprenant et champ\nCREATE INDEX IF NOT EXISTS idx_stats_champs_apprenant_champ ON stats_formulaires_champs(apprenant_id, champ_id);\n\n-- Index pour requêtes temporelles\nCREATE INDEX IF NOT EXISTS idx_stats_champs_created_at ON stats_formulaires_champs(created_at);\n\n-- ============================================================================\n-- Commentaires\n-- ============================================================================\n\nCOMMENT ON TABLE stats_formulaires_champs IS 'Statistiques détaillées par champ pour les exercices de formulaires - permet d''identifier les difficultés spécifiques (ex: email difficile, adresse ok)';\n\nCOMMENT ON COLUMN stats_formulaires_champs.champ_id IS 'Identifiant technique du champ (ex: \\"nom\\", \\"email\\", \\"code_postal\\")';\nCOMMENT ON COLUMN stats_formulaires_champs.champ_label IS 'Libellé affiché à l''apprenant (ex: \\"Nom de famille\\", \\"Adresse email\\")';\nCOMMENT ON COLUMN stats_formulaires_champs.champ_type IS 'Type HTML du champ: text, email, tel, date, number...';\nCOMMENT ON COLUMN stats_formulaires_champs.correct IS 'Le champ a-t-il été rempli correctement ?';\nCOMMENT ON COLUMN stats_formulaires_champs.valeur_attendue IS 'Valeur correcte attendue depuis profils_identite';\nCOMMENT ON COLUMN stats_formulaires_champs.valeur_saisie IS 'Valeur saisie par l''apprenant';\nCOMMENT ON COLUMN stats_formulaires_champs.temps_saisie_secondes IS 'Temps passé sur ce champ (focus -> blur) en secondes';"}	create_stats_formulaires_champs	mathieujouteux@gmail.com	\N
20251029081923	{"-- Migration: Ajout du type 'formulaire_identite' aux exercices\n-- Date: 2025-10-29\n-- Description: Ajoute le nouveau type d'exercice pour les formulaires d'identité\n\n-- ============================================================================\n-- Modification de la contrainte CHECK sur formation_exercices.type\n-- ============================================================================\n\n-- Supprimer l'ancienne contrainte\nALTER TABLE formation_exercices\n    DROP CONSTRAINT IF EXISTS formation_exercices_type_check;\n\n-- Ajouter la nouvelle contrainte avec le type 'formulaire_identite'\nALTER TABLE formation_exercices\n    ADD CONSTRAINT formation_exercices_type_check\n    CHECK (type IN ('qcm', 'ordering', 'matching', 'numeric', 'formulaire_identite'));\n\n-- ============================================================================\n-- Mise à jour du commentaire\n-- ============================================================================\n\nCOMMENT ON COLUMN formation_exercices.type IS 'Type d''exercice: qcm, ordering, matching, numeric, formulaire_identite';"}	add_formulaire_identite_type	mathieujouteux@gmail.com	\N
20251029124849	{"ALTER TABLE imagiers ADD COLUMN voix VARCHAR(50) DEFAULT 'Paul';"}	add_voix_column_to_imagiers	mathieujouteux@gmail.com	\N
20251029221409	{"-- Migration: Ajout du champ 'shared' à la table imagiers\n-- Date: 2025-10-29\n-- Description: Permet de partager des imagiers entre utilisateurs\n\n-- Ajouter la colonne 'shared' avec valeur par défaut false\nALTER TABLE imagiers\nADD COLUMN IF NOT EXISTS shared BOOLEAN DEFAULT false;\n\n-- Créer un index pour optimiser les requêtes sur les imagiers partagés\nCREATE INDEX IF NOT EXISTS idx_imagiers_shared ON imagiers(shared) WHERE shared = true;\n\n-- Commentaire sur la colonne\nCOMMENT ON COLUMN imagiers.shared IS 'Indique si l''imagier est partagé avec tous les apprenants';"}	add_shared_to_imagiers	mathieujouteux@gmail.com	\N
