-- Name: appliquer_correction_syllabification(text); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.appliquer_correction_syllabification(mot_param text) RETURNS text[]
    LANGUAGE plpgsql
    AS $$
DECLARE
    correction TEXT[];
BEGIN
    -- Récupérer la correction et incrémenter le compteur
    UPDATE corrections_syllabification 
    SET nombre_applications = nombre_applications + 1 
    WHERE mot = mot_param AND statut = 'actif'
    RETURNING segmentation_correcte INTO correction;
    
    RETURN correction;
END;
$$;


