-- Name: get_enregistrements_by_texte(integer, uuid); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.get_enregistrements_by_texte(p_texte_id integer, p_apprenant_id uuid) RETURNS TABLE(id integer, groupe_sens_id integer, ordre_groupe integer, audio_url text, duree_secondes numeric, taille_bytes integer, created_at timestamp with time zone)
    LANGUAGE plpgsql SECURITY DEFINER
    AS $$
BEGIN
    RETURN QUERY
    SELECT
        e.id,
        e.groupe_sens_id,
        g.ordre_groupe,
        e.audio_url,
        e.duree_secondes,
        e.taille_bytes,
        e.created_at
    FROM enregistrements_groupes e
    INNER JOIN groupes_sens g ON e.groupe_sens_id = g.id
    WHERE g.texte_reference_id = p_texte_id
      AND e.apprenant_id = p_apprenant_id
    ORDER BY g.ordre_groupe;
END;
$$;


